import React, { Component } from 'react';
import { StyleSheet, View, Alert, TouchableWithoutFeedback, Keyboard, KeyboardAvoidingView } from 'react-native';
import { TextInput, Button, Card, Avatar, Title, Snackbar, Appbar, RadioButton, Provider as PaperProvider } from 'react-native-paper';
import { setStatusBarHidden, StatusBar } from 'expo-status-bar';

class SignUp extends Component {

    constructor(props) {
        super(props)
        this.state = {
            email: "",
            username: "",
            password: "",
            phone: "",
            cnic: "",
            gender: ""
        }
    }

    onSignUp = () => {
        var data = {
            "email": this.state.email,
            "username": this.state.username,
            "password": this.state.password,
            "phone": this.state.phone,
            "cnic": this.state.cnic,
            "gender": this.state.gender
        }

        fetch("http://3e5b5e4b818d.ngrok.io/register", {
            method: "POST",
            headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(data)
        })
            .then(function (response) {
                return response.json();
            })
            .then(function (data) {
                console.log(data)
            });

        Alert.alert(
            "Alert Title",
            "My Alert Msg",
            [
                {
                    text: "Cancel",
                    onPress: () => console.log("Cancel Pressed"),
                    style: "cancel"
                },
                { text: "OK", onPress: () => console.log(this.state) }
            ],
            { cancelable: false }
        );
    }

    render() {

        const [checked, setChecked] = React.useState('first');

        const { username, password, email, phone, cnic, gender } = this.state;

        const styles = StyleSheet.create({
            container: {
                flex: 1
            },
            inner: {
                padding: 24,
                flex: 1,
                justifyContent: "space-around"
            },
            header: {
                fontSize: 36,
                marginBottom: 48
            },
            textInput: {
                height: 40,
                borderColor: "#000000",
                borderBottomWidth: 1,
                marginBottom: 36
            },
            btnContainer: {
                backgroundColor: "white",
                marginTop: 12
            }
        });

        return (
            <KeyboardAvoidingView
                behavior={Platform.OS === "ios" ? "padding" : "height"}
                style={styles.container}
            >
                <TouchableWithoutFeedback onPress={Keyboard.dismiss}>
                    <View style={{ flex: 1, justifyContent: 'center' }}>
                        <View style={{ width: '100%', alignSelf: 'center' }}>
                            <StatusBar style="auto" />
                            <Card>
                                <Card.Content>
                                    <Title>Sign Up</Title>
                                    <TextInput
                                        label="Email Address"
                                        value={email}
                                        onChangeText={text => this.setState({ email: text })}
                                    />
                                    <TextInput
                                        style={{ marginTop: 10 }}
                                        label="User Name"
                                        value={username}
                                        onChangeText={text => this.setState({ username: text })}
                                    />
                                    <TextInput
                                        style={{ marginTop: 10 }}
                                        secureTextEntry={true}
                                        label="Password"
                                        value={password}
                                        onChangeText={text => this.setState({ password: text })}
                                    />
                                    <TextInput
                                        style={{ marginTop: 10 }}
                                        label="Phone Number"
                                        value={phone}
                                        onChangeText={number => this.setState({ phone: number })}
                                    />
                                    <TextInput
                                        style={{ marginTop: 10 }}
                                        label="CNIC Number"
                                        value={cnic}
                                        onChangeText={number => this.setState({ cnic: number })}
                                    />
                                    {/* <TextInput
                                        style={{ marginTop: 10 }}
                                        label="Gender"
                                        value={gender}
                                        onChangeText={text => this.setState({ gender: text })}
                                    /> */}
                                    <Card.Actions style={{ justifyContent: 'center' }}>
                                        <Button style={{ marginTop: 10, justifyContent: 'center' }} contentStyle={{ height: 50 }}
                                            icon='login' mode="contained"
                                            onPress={() => this.onSignUp()}>
                                            Sign Up
                                </Button>
                                    </Card.Actions>
                                </Card.Content>
                            </Card>
                        </View>
                    </View>
                </TouchableWithoutFeedback>
            </KeyboardAvoidingView>
        )
    }
}

export default SignUp;
